using Algorithms.Interface;
using System;
using System.Collections.Generic;
using System.Text;

namespace Algorithms.StringManipulation
{
    public class SpecialStringAgain : IAlgorithm
    {
        public void Execute()
        {
            string s = "";
            char current = s[1];
            char prev = s[0];
            int indexOfRef = 0;
            int sum = 0;
            List<CharsInRow> listOfRows = new List<CharsInRow>();
            listOfRows.Add(new CharsInRow(1, prev));

            for (int i = 1; i < s.Length; i++)
            {
                if (current == prev) listOfRows[indexOfRef].repetitions++;
                else
                {
                    listOfRows.Add(new CharsInRow(1, current));
                    indexOfRef++;
                }

                prev = current;
                current = i < s.Length - 1 ? s[i + 1] : current;
            }

            for (int i = 0; i < listOfRows.Count; i++)
            {
                sum += listOfRows[i].calculate();
                if (
                    (i > 0 && i < listOfRows.Count - 1)
                    && (listOfRows[i - 1].character == listOfRows[i + 1].character
                    && listOfRows[i].repetitions == 1)
                )
                {
                    sum += Math.Min(listOfRows[i - 1].repetitions, listOfRows[i + 1].repetitions);

                }
            }

            Console.WriteLine("TOTAL: " + sum);

        }


    }

    public class CharsInRow
    {
        public int repetitions;
        public char character;

        public CharsInRow(int rep, char charac)
        {
            this.character = charac;
            this.repetitions = rep;
        }

        public int calculate()
        {
            int total = 0;
            int c = repetitions;
            while (c > 0)
            {
                total += c;
                c--;
            }
            return total;
        }

        public override string ToString()
        {
            return $"character: {this.character} | repetitions: {this.repetitions}";
        }
    }
}
